import { ThemeProvider } from 'styled-components';
import GlobalStyles from './styles/GlobalStyles';


function App() {
  return (
    <>
    <ThemeProvider/>
    <GlobalStyles/>
    <main className="app">
      DHANRAJ
    </main>
    </>
  );
}

export default App;
